import React from "react";
import { StyleSheet, Image, View, Text } from 'react-native';
import TextCenter from "../components/TextCenter";


const Home = (props) => {
  return (
    <View>
      <TextCenter text="InfoTec" />
      <Image
        style={styles.foto}
        source={{
          uri: 'https://github.com/francinelio/petmania/blob/react/src/components/header/logo-petmania.png?raw=true',
        }}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  foto: {
    width: 300,
    height: 88,
    marginVertical: 20,
  },
  btn: {
    color: 'darkcyan',
    margin: 10,
  },
});

export default Home;
